import React from 'react';
import './HomePage.css';

const HomePage = () => {
  return (
    <div className="home-page-container">
      <h1>Welcome to My App</h1>
      <p>This is the home page of my app. Please use the buttons below to navigate.</p>
      <div className="button-container">
        <div>
            <button className="big-beautiful-button">Button 1</button>
        </div>
        <div>
            <button className="big-beautiful-button">Button 2</button>
        </div>
        <div>
            <button className="big-beautiful-button">Button 3</button>
        </div>
        <div>
            <button className="big-beautiful-button">Button 4</button>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
